import React from 'react';
import styled from 'styled-components';

const NavContainer = styled.ul`
    background-color: #55f;
    width: 100%;
    height: 560px;
    & > li {
        height: 80px;
        position: relative;
        &:hover {
            cursor: pointer;
            background-color: #77f;
            &::after {
                content: '';
                position: absolute;
                border-style: solid;
                border-width: 20px 0 20px 20px;
                border-color: transparent #77f;
                display: block;
                width: 0;
                z-index: 1;
                top: 20px;
                right: -15px;
            }
        }
        &:not(:last-child) {
            border-bottom: 1px solid #aaf;
        }
    }
`;

const AdminNav = () => {
    return (
        <NavContainer>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
        </NavContainer>
    );
};

export default AdminNav;
